package com.fashion.binge.fashiondesign.models;/** * Created by gokarna on 14/07/16. */public class CouponModel {    private String title;    private String code;    private String value;    private String text;    private String storeId;    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }    public String getValue() {        return value;    }    public void setValue(String value) {        this.value = value;    }    public String getText() {        return text;    }    public void setText(String text) {        this.text = text;    }    public String getStoreId() {        return storeId;    }    public void setStoreId(String storeId) {        this.storeId = storeId;    }}